"use strict";

(function () {
  document.addEventListener("DOMContentLoaded", function () {
    var $btn = document.createElement("button");
    $btn.setAttribute("aria-label", "Вернуться к началу страницы");
    $btn.classList.add("btn-up");
    document.body.append($btn);
    window.addEventListener("scroll", trackScroll);
    function trackScroll() {
      var offset = window.pageYOffset;
      var winHeigth = document.documentElement.clientHeight;
      if (offset > winHeigth) {
        $btn.classList.add("btn-up--active");
      } else {
        $btn.classList.remove("btn-up--active");
      }
    }
    $btn.addEventListener("click", goTop);
    function goTop() {
      if (window.scrollY > 0) {
        window.scrollTo({
          top: 0,
          behavior: "smooth"
        });
      }
    }
  });
})();
"use strict";

(function () {
  var burger = document.querySelector(".burger");
  var headerList = document.querySelector(".header__list");
  var listLink = document.querySelectorAll(".list__link");
  var heroFoto = document.querySelector(".hero__foto");
  console.log(heroFoto);
  burger.addEventListener("click", function () {
    if (!burger.classList.contains("burger-active")) {
      burger.classList.add("burger-active");
      headerList.classList.add("list-open");
      document.body.classList.add("stop-scroll");
      heroFoto.classList.add("none");
    } else {
      burger.classList.remove("burger-active");
      headerList.classList.remove("list-open");
      document.body.classList.remove("stop-scroll");
      heroFoto.classList.remove("none");
    }
  });
  listLink.forEach(function (el) {
    el.addEventListener("click", function () {
      console.dir(el);
      burger.classList.remove("burger-active");
      headerList.classList.remove("list-open");
      document.body.classList.remove("stop-scroll");
      heroFoto.classList.remove("none");
    });
  });
})();
